import React from "react";
import notes from "../notes";

function Note() {
    return (
        notes.map( (entry) => (
            <div className="note">
                <h1>{entry.title}</h1>
                <p>{entry.content}</p>
            </div>
        ))
        
    );
}

export default Note;
